// src/pages/Homepage.js
import React from 'react';

const Homepage = () => {
   return (
      <div className="homepage">
         <h1>Welcome to College Sports Event Management</h1>
         <p>Your portal to participate in, manage, and track all college sports events.</p>
         <p>To get started, please <a href="/register">Register</a> or <a href="/login">Login</a>.</p>
      </div>
   );
};

export default Homepage;
